import { useState } from "react"


const Tasks = () => {
    const [tasks, setTasks] = useState([
        {
            id: 1,
            text: 'Doctors Appoitment',
            day: 'July 5th at 2:30pm',
            reminder: true,
        },
        {
            id: 2,
            text: 'School Meetings',
            day: 'June 17th at 1:30pm',
            reminder: true,
        },
        {
            id: 3,
            text: 'Food Shopping',
            day: 'June 15th at 2:30pm',
            reminder: false,
        },
    ])

  return (
    <>
    {tasks.map((task) => (<h3 key = {task.id} >{task.text}</h3>))}
    </>
  )
}

export default Tasks
